export function isLastFilledCell(value, index) {
    return value != null && value.length - 2 === index;
}
export function getSymbols(codeValue, codeLength) {
    const symbols = new Array(codeLength);
    for (let i = 0; i < codeLength; i++) {
        symbols[i] = codeValue[i] ?? '';
    }
    return symbols;
}
